Reply:
Na Turquia, a legislação relacionada à pornografia é bastante restritiva, especialmente no que diz respeito à proteção dos menores e a conteúdos considerados moralmente inadequados. Especificamente, é proibido qualquer conteúdo sexual envolvendo menores de idade (menores de 18 anos), bem como pornografia que seja considerada obscena, que promova violência sexual, exploração ou qualquer forma de abuso.

Além disso, conteúdos que contrariem valores sociais e culturais predominantes, como pornografia envolvendo incesto ou atos que possam ser interpretados como imorais pela lei turca, também são frequentemente censurados. A divulgação, produção e distribuição de pornografia ilegal podem acarretar sanções severas.

Resumindo, o conteúdo sexual proibido na pornografia na Turquia inclui:

- Pornografia infantil (menores de 18 anos);
- Conteúdos que envolvam violência sexual ou exploração;
- Conteúdos considerados obscenos de acordo com a legislação local;
- Material que atente contra valores sociais e culturais estabelecidos.

A fiscalização e o bloqueio de sites pornográficos contendo esses conteúdos são comuns no país.

