EnglishTranslation:
In Turkey, legislation relating to pornography is quite restrictive, especially with regard to the protection of minors and content considered morally inappropriate. Specifically, any sexual content involving minors (under 18) is prohibited, as well as pornography that is considered obscene, promotes sexual violence, exploitation or any form of abuse.

In addition, content that goes against prevailing social and cultural values, such as pornography involving incest or acts that could be interpreted as immoral by Turkish law, is also often censored. The dissemination, production and distribution of illegal pornography can carry severe penalties.

In short, prohibited sexual content in pornography in Turkey includes:

- Child pornography (under 18);
- Content involving sexual violence or exploitation;
- Content considered obscene according to local legislation;
- Material that goes against established social and cultural values.

Surveillance and blocking of pornographic sites containing such content is common in the country.

